" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Vitamin A and vitamin D (topical): Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?40/17/41235?source=see_link\">",
"    see \"Vitamin A and vitamin D (topical): Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F14332638\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      A+D&reg; Original [OTC];",
"     </li>",
"     <li>",
"      Baza&reg; Clear [OTC];",
"     </li>",
"     <li>",
"      Sween Cream&reg; [OTC]",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F14332641\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Topical Skin Product",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F14332657\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Skin protectant:",
"     </b>",
"     Topical: Apply to affected areas as needed.",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F14332656\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Diaper rash:",
"     </b>",
"     Topical: Apply with each diaper change and any time prolonged exposure to wet diapers may occur (ie, at bedtime).",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Skin protectant:",
"     </b>",
"     Topical: Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F14332658\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F14332668\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Cream, topical:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Sween Cream&reg;:  (57 g, 142 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Cream, topical [original formula]:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Sween Cream&reg;:  (2 g, 14 g, 85 g, 184 g, 339 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Ointment, topical:  (5 g, 60 g, 120 g, 454 g)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     A+D&reg; Original:  (42.5 g); (120 g);  (454 g) [in lanolin-petrolatum base]",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Baza&reg; Clear:  (50 g, 142 g, 227 g) [in petrolatum base]",
"    </p>",
"   </div>",
"   <div class=\"block geq drugH1Div\" id=\"F14332640\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Yes: Ointment",
"    </p>",
"   </div>",
"   <div class=\"block adm drugH1Div\" id=\"F14693356\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Administration",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     For external use only; avoid contact with eyes. Do not use on animal bites, severe burns, deep or puncture wounds,  or lacerations.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Diaper rash: Clean area and allow to dry thoroughly prior to application.",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F14332645\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Temporary relief of discomfort due to chapped skin or lips, cuts and scrapes, diaper rash, or minor burns",
"    </p>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F14332650\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Frequency not defined: Local: Irritation",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F14332646\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     There are no contraindications listed in the manufacturer's labeling.",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F14332647\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      <i>",
"       Other warnings/precautions:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Appropriate use: For external use only; avoid contact with eyes. Do not use on animal bites, severe burns, deep or puncture wounds, or lacerations.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Self-medication (OTC use): Stop use and consult healthcare provider if condition worsens, symptoms last &gt;7 days, or if symptoms resolve and then recur within a few days.",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F14975293\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     None known.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F14975291\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
"     (For additional information:",
"     <a class=\"dip\" href=\"./drug-interaction\" target=\"_blank\">",
"      Launch Lexi-Interact&trade; Drug Interactions Program",
"     </a>",
"     )",
"    </div>",
"    <div class=\"lexi\" id=\"lexiInteractImgB\">",
"     <img border=\"0\" height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"    </div>",
"    <div class=\"clear\">",
"    </div>",
"    <p style=\"text-indent:0em;display:inline\">",
"     There are no known significant interactions.",
"    </p>",
"   </div>",
"  </div>",
