var title_f13_21_13653="Collateral circulation SVC syndrome";
var content_f13_21_13653=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F75771&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F75771&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Collateral circulation from superior vena cava syndrome falsely suggests a liver \"hot spot\".",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 546px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Contrast-enhanced axial CT image shows a dilated internal mammary (IM) vein (red arrow) connecting to the portal and hepatic venous circulation to eventually drain into the inferior vena cava (IVC). This process appears to form an enhancing liver \"hot spot\" that is actually draining venous blood from the obstructed SVC. Note also the dilated azygos and hemiazygos veins (white arrowheads) that connect to the ascending lumbar veins and IVC. Bottom panel: Axial image at the level of the liver shows segmental enhancement of parts of the right and left lobes due to collateral flow from the IM vein.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
