" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 559px\">",
"   <div class=\"ttl\">",
"    These panels show progressive Doppler abnormality in the ductus venosus, inferior vena cava, and umbilical vein",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 539px; height: 496px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
