var title_f13_21_13661="Monitoring drug Rx of RA";
var content_f13_21_13661=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F78846&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F78846&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Monitoring strategies for drug treatment of rheumatoid arthritis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drugs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Ongoing monitoring via system review and physical examination",
"       </td>",
"       <td class=\"subtitle1\">",
"        Ongoing monitoring via laboratory tests",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Salicylates, nonsteroidal antiinflammatory drugs",
"       </td>",
"       <td>",
"        Dark/black stool, dyspepsia, nausea/vomiting, abdominal pain, edema, shortness of breath",
"       </td>",
"       <td>",
"        CBC yearly, LFTs, creatinine testing may be required*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hydroxychloroquine",
"       </td>",
"       <td>",
"        Visual changes, periodic funduscopic and visual field examination&bull;",
"       </td>",
"       <td>",
"        None after baseline",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sulfasalazine",
"       </td>",
"       <td>",
"        Symptoms of myelosuppression&Delta;, photosensitivity, rash",
"       </td>",
"       <td>",
"        CBC, aminotransferases and creatinine every 2 to 4 weeks for the first 3 months or after increasing the dose, every 8 to 12 weeks for months 3 to 6, then every 12 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Methotrexate",
"       </td>",
"       <td>",
"        Symptoms of myelosuppression&Delta;, shortness of breath, nausea or vomiting, lymph node swelling",
"       </td>",
"       <td>",
"        CBC, aminotransferases and creatinine every 2 to 4 weeks for the first 3 months or after increasing the dose, every 8 to 12 weeks for months 3 to 6, then every 12 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Leflunomide",
"       </td>",
"       <td>",
"        Diarrhea, alopecia, intercurrent liver, gallbladder, and renal disease, pregnancy or delayed menses",
"       </td>",
"       <td>",
"        CBC, aminotransferases and creatinine every 2 to 4 weeks for the first 3 months or after increasing the dose, every 8 to 12 weeks for months 3 to 6, then every 12 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Minocycline",
"       </td>",
"       <td>",
"        Hyperpigmentation, dizziness, vaginal yeast infections",
"       </td>",
"       <td>",
"        None after baseline",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Azathioprine",
"       </td>",
"       <td>",
"        Symptoms of myelosuppression&Delta;",
"       </td>",
"       <td>",
"        CBC and platelet count every 1 to 2 weeks with changes in dosage, every 1 to 3 months thereafter",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Glucocorticoids",
"       </td>",
"       <td>",
"        BP at each visit, polyuria, polydipsia, edema, shortness of breath, visual changes (including cataracts), weight gain",
"       </td>",
"       <td>",
"        Urinalysis for glucose yearly, bone mineral density&loz;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cyclophosphamide",
"       </td>",
"       <td>",
"        Symptoms of myelosuppression&Delta;, hematuria",
"       </td>",
"       <td>",
"        CBC and platelet count every 1 to 2 weeks with changes in dosage, and every 1 to 3 months thereafter, urinalysis and urine cytology every 6 to 12 months after cessation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cyclosporine",
"       </td>",
"       <td>",
"        Edema, BP every 2 weeks until dosage stable, then monthly",
"       </td>",
"       <td>",
"        Creatinine every 2 weeks until dose is stable, then monthly; periodic CBC, potassium, LFTs",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Package insert for diclofenac (Voltaren) recommends that AST and ALT be monitored within the first 8 weeks of treatment and periodically thereafter. Monitoring of serum creatinine should be performed weekly for at least 3 weeks in patients receiving concomitant angiotensin-converting enzyme inhibitors or diuretics.",
"     <br>",
"      &bull;&nbsp;Refer to&nbsp;the UpToDate topic on antimalarial drugs in the treatment of rheumatic disease.",
"      <br>",
"       &Delta; Symptoms of myelosuppression include fever, symptoms of infection, easily bruisability, and bleeding.",
"       <br>",
"        &loz; Monitoring for osteoporosis is discussed in the UpToDate topics on the pathogenesis, clinical features, and evaluation of glucocorticoid-induced osteoporosis and on the prevention and treatment of glucocorticoid-induced osteoporosis.",
"        <br>",
"         CBC: complete blood cell count (hematocrit, hemoglobin, white blood cell count) including differential cell and platelet counts; AST: aspartate aminotransferase; LFTs: liver function tests; BP: blood pressure.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Ad Hoc Committee on Clinical Guidelines. Guidelines for monitoring drug therapy in rheumatoid arthritis. American College of Rheumatology Arthritis Rheum 1996; 39:723; American College of Rheumatology Subcommittee on Rheumatoid Arthritis Guidelines. Guidelines for the Management of Rheumatoid Arthritis 2002 Update. Arthritis Rheum 2002; 46:328; and Saag KG, Teng GG, Patkar NM, et al. American College of Rheumatology 2008 recommendations for the use of nonbiologic and biologic disease-modifying antirheumatic drugs in rheumatoid arthritis. Arthritis Rheum 2008; 59:762.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
